import React from 'react';
import Button from '@mui/material/Button';

function Navbar() {
  return (
    <nav class="nav-bar">
      <button>Home</button>
      <button>Favourites</button>

      <Button variant="contained" color="primary">
        Click me
      </Button>
    </nav>
  );
}

export default Navbar;
